import React, { useState } from 'react';
import fakeData from '../../../fakeData.js';
import Customer_layout from '../../../pages/customer_layout';

const Home = () => {
	const [ products, setProducts] = useState(fakeData);
	const section = <>
						{products.map((product, index) => 
							<div className="col-sm-6 col-lg-4 text-center item mb-4">
						        <a href="#"> <img src={product.images} alt="Image" /></a>
						        <h3 className="text-dark"><a href="#">{product.name}</a></h3>
						        <p className="price"><del></del>{product.price}</p>
						    </div>
						)}
					</>
	return (
		<div>
			<Customer_layout section={section} />
		</div>
	)
}

export default Home
